INSERT INTO `cache_field` VALUES ('field:node:1','a:2:{s:4:\"body\";a:1:{s:3:\"und\";a:1:{i:0;a:5:{s:5:\"value\";s:3070:\"<div id=\"first-time\">\n\n\nIf you are new to Drupal, follow these steps to set up your web site in minutes:\n\n<strong>Step 1. Start at the beginning</strong>\n\nVisit the <a href=\"/admin\">administration section</a> for a task-based or <a href=\"/admin/index\">module-based</a> overview of the options available to configure your website.</li>\n\n<strong>Step 2. Connect to the Acquia Network</strong>\n\nAt any time you can activate an <a href=\"http://network.acquia.com/\">Acquia Network</a> subscription to gain access to Acquia\'s timely, professional support, automated services such as Mollom spam blocking, Acquia Library and documentation. Acquia offers subscription levels for every size web site - from individual blogs to enterprise-scale, multi-site deployments.  Once you have your Acquia Network subscription keys, enter them on the <a href=\"/admin/config/system/acquia-agent\">settings page</a>. Get started with a <a href=\"http://network.acquia.com/\">free trial</a> today.\n\n<strong>Step 3. Activate functionality</strong>\n\nTurn on added functionality for your site - blogs, forums, polls, tags, comments, and more. Acquia Drupal comes with important <a href=\"/admin/modules\">modules</a> to power social publishing capabilities on your site.\n\nHundreds of additional Drupal 7.x compatible modules are available on Drupal.org in the <a href=\"http://drupal.org/project/Modules\">Drupal modules download section</a>, which you can install <a href=\"/admin/modules\">through your modules page</a>.\n\n<strong>Step 4. Start publishing content</strong>\n\nStart <a href=\"/node/add\">creating content</a> for your site. Depending on which modules you have activated, you may see blogs, forums, polls and more as available content types.\n\n<hr />\n\n<p>Some optional configuration tasks are shown below. For more information, please refer to the built-in <a href=\"/admin/help\">help section</a>, or the <a href=\"http://drupal.org/handbooks\">online Drupal handbooks</a>.</p>\n\n<strong>Choose a different design</strong>\n\nStart by <a href=\"/admin/appearance/settings/bartik\">changing the colors</a> of the default theme.  To change the fundamental \"look and feel\" of your website, visit the <a href=\"/admin/appearance\">appearance section</a> and choose a theme from one of the many themes available out-of-the-box.\n\nMany additional Drupal 7.x compatible themes are available on Drupal.org in the <a href=\"http://drupal.org/project/Themes\">Drupal themes download section</a>, which you can install <a href=\"/admin/appearance\">through your themes page</a>.\n\n<strong>Configure the front page</strong>\n\nThe default front page is a listing of all content marked as <q>Promoted to front page</q>.  You can manage your content from the <a href=\"/admin/content\">content administration page</a>. You can also designate, for example, an item of content you have created as the front page. See the <a href=\"/admin/config/system/site-information\">site information settings page</a> to configure the default front page path.  You can also edit you site name and add a slogan to make the site your own.\n</div>\";s:7:\"summary\";s:3070:\"<div id=\"first-time\">\n\n\nIf you are new to Drupal, follow these steps to set up your web site in minutes:\n\n<strong>Step 1. Start at the beginning</strong>\n\nVisit the <a href=\"/admin\">administration section</a> for a task-based or <a href=\"/admin/index\">module-based</a> overview of the options available to configure your website.</li>\n\n<strong>Step 2. Connect to the Acquia Network</strong>\n\nAt any time you can activate an <a href=\"http://network.acquia.com/\">Acquia Network</a> subscription to gain access to Acquia\'s timely, professional support, automated services such as Mollom spam blocking, Acquia Library and documentation. Acquia offers subscription levels for every size web site - from individual blogs to enterprise-scale, multi-site deployments.  Once you have your Acquia Network subscription keys, enter them on the <a href=\"/admin/config/system/acquia-agent\">settings page</a>. Get started with a <a href=\"http://network.acquia.com/\">free trial</a> today.\n\n<strong>Step 3. Activate functionality</strong>\n\nTurn on added functionality for your site - blogs, forums, polls, tags, comments, and more. Acquia Drupal comes with important <a href=\"/admin/modules\">modules</a> to power social publishing capabilities on your site.\n\nHundreds of additional Drupal 7.x compatible modules are available on Drupal.org in the <a href=\"http://drupal.org/project/Modules\">Drupal modules download section</a>, which you can install <a href=\"/admin/modules\">through your modules page</a>.\n\n<strong>Step 4. Start publishing content</strong>\n\nStart <a href=\"/node/add\">creating content</a> for your site. Depending on which modules you have activated, you may see blogs, forums, polls and more as available content types.\n\n<hr />\n\n<p>Some optional configuration tasks are shown below. For more information, please refer to the built-in <a href=\"/admin/help\">help section</a>, or the <a href=\"http://drupal.org/handbooks\">online Drupal handbooks</a>.</p>\n\n<strong>Choose a different design</strong>\n\nStart by <a href=\"/admin/appearance/settings/bartik\">changing the colors</a> of the default theme.  To change the fundamental \"look and feel\" of your website, visit the <a href=\"/admin/appearance\">appearance section</a> and choose a theme from one of the many themes available out-of-the-box.\n\nMany additional Drupal 7.x compatible themes are available on Drupal.org in the <a href=\"http://drupal.org/project/Themes\">Drupal themes download section</a>, which you can install <a href=\"/admin/appearance\">through your themes page</a>.\n\n<strong>Configure the front page</strong>\n\nThe default front page is a listing of all content marked as <q>Promoted to front page</q>.  You can manage your content from the <a href=\"/admin/content\">content administration page</a>. You can also designate, for example, an item of content you have created as the front page. See the <a href=\"/admin/config/system/site-information\">site information settings page</a> to configure the default front page path.  You can also edit you site name and add a slogan to make the site your own.\n</div>\";s:6:\"format\";s:9:\"full_html\";s:10:\"safe_value\";s:3152:\"<div id=\"first-time\">\n<p>If you are new to Drupal, follow these steps to set up your web site in minutes:</p>\n<p><strong>Step 1. Start at the beginning</strong></p>\n<p>Visit the <a href=\"/admin\">administration section</a> for a task-based or <a href=\"/admin/index\">module-based</a> overview of the options available to configure your website.\n</p><p><strong>Step 2. Connect to the Acquia Network</strong></p>\n<p>At any time you can activate an <a href=\"http://network.acquia.com/\">Acquia Network</a> subscription to gain access to Acquia\'s timely, professional support, automated services such as Mollom spam blocking, Acquia Library and documentation. Acquia offers subscription levels for every size web site - from individual blogs to enterprise-scale, multi-site deployments.  Once you have your Acquia Network subscription keys, enter them on the <a href=\"/admin/config/system/acquia-agent\">settings page</a>. Get started with a <a href=\"http://network.acquia.com/\">free trial</a> today.</p>\n<p><strong>Step 3. Activate functionality</strong></p>\n<p>Turn on added functionality for your site - blogs, forums, polls, tags, comments, and more. Acquia Drupal comes with important <a href=\"/admin/modules\">modules</a> to power social publishing capabilities on your site.</p>\n<p>Hundreds of additional Drupal 7.x compatible modules are available on Drupal.org in the <a href=\"http://drupal.org/project/Modules\">Drupal modules download section</a>, which you can install <a href=\"/admin/modules\">through your modules page</a>.</p>\n<p><strong>Step 4. Start publishing content</strong></p>\n<p>Start <a href=\"/node/add\">creating content</a> for your site. Depending on which modules you have activated, you may see blogs, forums, polls and more as available content types.</p>\n<hr /><p>Some optional configuration tasks are shown below. For more information, please refer to the built-in <a href=\"/admin/help\">help section</a>, or the <a href=\"http://drupal.org/handbooks\">online Drupal handbooks</a>.</p>\n<p><strong>Choose a different design</strong></p>\n<p>Start by <a href=\"/admin/appearance/settings/bartik\">changing the colors</a> of the default theme.  To change the fundamental \"look and feel\" of your website, visit the <a href=\"/admin/appearance\">appearance section</a> and choose a theme from one of the many themes available out-of-the-box.</p>\n<p>Many additional Drupal 7.x compatible themes are available on Drupal.org in the <a href=\"http://drupal.org/project/Themes\">Drupal themes download section</a>, which you can install <a href=\"/admin/appearance\">through your themes page</a>.</p>\n<p><strong>Configure the front page</strong></p>\n<p>The default front page is a listing of all content marked as <q>Promoted to front page</q>.  You can manage your content from the <a href=\"/admin/content\">content administration page</a>. You can also designate, for example, an item of content you have created as the front page. See the <a href=\"/admin/config/system/site-information\">site information settings page</a> to configure the default front page path.  You can also edit you site name and add a slogan to make the site your own.\n</p></div>\n\";s:12:\"safe_summary\";s:3152:\"<div id=\"first-time\">\n<p>If you are new to Drupal, follow these steps to set up your web site in minutes:</p>\n<p><strong>Step 1. Start at the beginning</strong></p>\n<p>Visit the <a href=\"/admin\">administration section</a> for a task-based or <a 